import React from "react";
import PropTypes from "prop-types";

const AllGradeList = ({ title, schoolYear, grades }) => {
  return (
    <div>
      <div>{title}</div>
      <div>
          {
              grades.map(grade=>(
                  <div>
                      {grade}
                      <table>
                          <tbody>
                          {schoolYear.map(grade => (
                              <React.Fragment>
                                  {grade.grade === 1 ? (
                                      <tr className="search_row">
                                          <td>
                                              {grade.grade}
                                              {grade.subGrade}
                                          </td>
                                          <td>{grade.teacher}</td>
                                          <td>
                                              <button className="stu_add">redakciika :)</button>
                                          </td>
                                      </tr>
                                  ) : (
                                      ""
                                  )}
                              </React.Fragment>
                          ))}
                          </tbody>
                      </table>
                  </div>
              ))

          }

      </div>
    </div>
  );
};

AllGradeList.propTypes = {};

export default AllGradeList;
